pub enum PatternElement<'ast> {
    TextElement(&'ast str),
    Placeable(Expression),
}

pub enum VariantKey<'ast> {
    Identifier {
            name: &'ast str,
        },
    NumberLiteral {
            value: &'ast str,
        },
}

pub enum Comment<'ast> {
    Comment {
            content: Vec<&'ast str>,
        },
    GroupComment {
            content: Vec<&'ast str>,
        },
    ResourceComment {
            content: Vec<&'ast str>,
        },
}

pub enum InlineExpression<'ast> {
    StringLiteral {
            value: &'ast str,
        },
    NumberLiteral {
            value: &'ast str,
        },
    FunctionReference {
            id: Identifier,
            arguments: Option<CallArguments>,
        },
    MessageReference {
            id: Identifier,
            attribute: Option<Identifier>,
        },
    TermReference {
            id: Identifier,
            attribute: Option<Identifier>,
            arguments: Option<CallArguments>,
        },
    VariableReference {
            id: Identifier,
        },
    Placeable {
            expression: Box<Expression>,
        },
}

pub enum Expression<'ast> {
    InlineExpression(InlineExpression),
    SelectExpression {
            selector: InlineExpression,
            variants: Vec<Variant>,
        },
}
